}

const Discover: FC<IProps> = (): JSX.Element => {
  return (
    <div>
      <div>Discover component</div>
      <div>
        <Link to="./discover/recommend">推荐</Link>
        <Link to="./discover/ranking">排行榜</Link>
        <Link to="./discover/songs">歌单</Link>
      </div>
      <Outlet />
    </div>
  );
};

export default memo(Discover);
